objectDesc.p:
k. 1
Arkusz błękitnego papieru o wymiarach 210x172. Zawiera pieczęć Archiwum Filomatów. Brak znaku wodnego. Atrament czarny. Obwoluta z opisem dokumentu, prawdopodobnie z XIX w., pióro, czarny atrament; opisane miejsce powstania D – wieś, w której przebywał Chlewiński pod dozorem policji; dot. procesu filaretów w Wilnie; wym. Obw.: 210x130;
Datowanie 17 kwietnia 1824, A lekko uszkodzony z prawej strony bez uszczerbku dla tekstu

k. 4-6
Trzy arkusze białego papieru o wymiarach 207x151, 146x130 i 90x105. Zawierają pieczęć Archiwum Filomatów. Znak wodny: A 1 i 2 bez filigranu; A 3 fragmentaryczny filigran nieczytelny. Atrament czarny. A 1 brak datowania autora, na fiszce sugerowana data 3 grudnia 1823 r. ślady złożenia w pionie i poziomie, k 4 verso adresat i adres Pietraszkiewicza;
A 2 uszkodzony: prawy górny róg oderwany ze szkodą dla tekstu, k 5 v zapisana tylko lewostronnie w pionie i poziomie; pisana ołówkiem
A 3: ślady złożenia na 4;
Obwoluta: zapisana piórem, czarny atrament; możliwe, że XIX w.; podaje opis zawartości i autora listów z więzienia z lat 1823-1824, w tym prośba o wytyczne co do zeznań po przyznaniu się Malewskiego.
